import React from 'react';
import { Link } from 'react-router-dom';
import { Link as ScrollLink } from 'react-scroll';

const Level1Page = () => {
  return (
    <div className="container mt-5">
      <div className="text-center">
        <h1 className="font-weight-bold">Level 1</h1>
        {/* Add your visually appealing content here */}
        <ScrollLink to="scrollToNext" smooth={true} duration={500} offset={-50} className="btn btn-primary">
          Next Page
        </ScrollLink>
      </div>
      <div id="scrollToNext" style={{ height: '500px' }}></div> {/* Add a div to scroll to */}
    </div>
  );
};

export default Level1;
